window.bookSummaryJSON = "<p>Years in the making, Sarah J. Maas's number-one global bestselling phenomenon Throne of Glass series draws to an epic, unforgettable conclusion. Aelin Galathynius's journey from slave to king's assassin to the queen of a once-great kingdom reaches its heart-rending finale as war erupts across her world....</p> <p>Aelin has risked everything to save her people - but at a tremendous cost. Locked within an iron coffin by the Queen of the Fae, Aelin must draw upon her fiery will as she endures months of torture. Aware that yielding to Maeve will doom those she loves keeps her from breaking, though her resolve begins to unravel with each passing day....</p> <p>With Aelin captured, Aedion and Lysandra remain the last line of defense to protect Terrasen from utter destruction. Yet they soon realize that the many allies they've gathered to battle Erawan's hordes might not be enough to save them. Scattered across the continent and racing against time, Chaol, Manon, and Dorian are forced to forge their own paths to meet their fates. Hanging in the balance is any hope of salvation - and a better world.</p> <p>And across the sea, his companions unwavering beside him, Rowan hunts to find his captured wife and queen - before she is lost to him forever.</p> <p>As the threads of fate weave together at last, all must fight, if they are to have a chance at a future. Some bonds will grow even deeper, while others will be severed forever in the explosive final chapter of the Throne of Glass series.</p>"; 
